import React from "react";
// Estilos
import './App.scss';
// Sistema de Routeo
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import routes from "./config/routes";

// Componentes
import AdminHome from './pages/Admin';


function App() {
  return (
      <Router>
        <Routes>
           {/* el metodo routes.map es como un bule que recorre el array "routes"
            devolviendo "route" como cada item, e index como la posiciÃ³n */}
          {routes.map((route, index) => (
            <Route 
              key={index} 
              path={route.path} 
              element={ <route.layout>
                          <route.component/>
                        </route.layout>
              }/>
          ))} 
        </Routes>


      </Router> 
  );
};

export default App;
